function addACat(a){$.ajax({type:"POST",url:"/addCat",data:a,success:function(a){$.ajax({type:"GET",url:"/cats",success:function(a){for(i=0;i<a.length;i++)$(".cats").append("<p>"+a[i].name+"</p>")}})}})}$(document).ready(function(){$(".sandwich").keyup(function(){$(".eatingSandwich").html($(this).val())}),$(".formCat").on("submit",function(a){a.preventDefault();var b={};$.each($(".formCat").serializeArray(),function(a,c){b[c.name]=c.value}),$(".cats").empty(),addACat(b)})});